import SearchBar from "./SearchBar";
import BoxMain from "./BoxMain";
import BoxDown from "./BoxDown";

const LeftContainer = ({ data }) => {
    return (
        <>
            <SearchBar />
            <BoxMain data={data} />
            <BoxDown />
        </>
    )
};

export default LeftContainer
